import React from "react";
import "./About.scss";
import { mongodb } from "../../assets/icons/mongodb.png";
import { express } from "../../assets/icons/express.svg";
import { react } from "../../assets/icons/react.svg";
import { nodejs } from "../../assets/icons/nodejs.png";
import { bootstrap } from "../../assets/icons/bootstrap.svg";
import { sass } from "../../assets/icons/sass.svg";
import { stripe } from "../../assets/icons/stripe.svg";
import { Container, Row, Col, Image } from "bootstrap";

function About() {
  return (
    <section className="about">
      <h1 className="about__title">
        This application was built using Mern stack
      </h1>
      <Container>
        <Row>
          <Col xs={6} md={4}>
            <Image src={mongodb} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={express} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={react} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={nodejs} rounded />
          </Col>
        </Row>
        <Row>
          <Col xs={6} md={4}>
            <Image src={bootstrap} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={sass} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={stripe} rounded />
          </Col>
          <Col xs={6} md={4}>
            <Image src={nodejs} rounded />
          </Col>
        </Row>
      </Container>
    </section>
  );
}

export default About;
